(function($) {
    var mobile = $('body.mobile').length ? true : false;

    var COOKIE_NAME = 'disableslidingbox1';
    var POSITION_RIGHT = mobile ? -5 : 15;
    var POSITION_BOTTOM = mobile ? -5 : 15;
    var POSITION_HIDDEN_RIGHT = -500;
    var POSITION_HIDDEN_BOTTOM = -500;

    var readyToAnimate = true,
        shownFlag = false,
        isVisible = false;

    var animationOptions = {
        start: function() {
            $(this).css('right', POSITION_RIGHT + 'px');
        },
        complete: function() {
            readyToAnimate = true;
            isVisible = parseInt($(this).css('bottom')) >= -5;
            if (!isVisible) {
                $(this).css('right', POSITION_HIDDEN_RIGHT + 'px');
            }
        }
    };

    AdMeCommon.Article.LikeBoxBottom = function(options) {
        this.options = $.extend({
            container: null,
            needToShow: null
        }, options);

        this.container = this.options.container;
    };

    Lixil.mixin(AdMeCommon.Article.LikeBoxBottom.prototype, {
        show: function() {
            if (!readyToAnimate || isVisible) {
                return;
            }
            readyToAnimate = false;

            animationOptions.duration = 500;
            this.container.animate({
                bottom: POSITION_BOTTOM + 'px'
            }, animationOptions);

            if (!shownFlag) {
                Analytics.event(this.container.data('ga-category'), this.container.data('ga-action'));
                shownFlag = true;
            }
        },
        hide: function() {
            if (!readyToAnimate || !isVisible) {
                return;
            }
            readyToAnimate = false;

            animationOptions.duration = 300;
            this.container.animate({
                    bottom: POSITION_HIDDEN_BOTTOM + 'px'
                },
                animationOptions
            );
        },
        init: function() {
            var self = this;

            if ($.cookie(COOKIE_NAME)) {
                return;
            }

            self.container.find('.js-close, .js-hide').on('click', function(e) {
                e.preventDefault();

                if ($(this).data('ga-category') && $(this).data('ga-action')) {
                    Analytics.event($(this).data('ga-category'), $(this).data('ga-action'));
                }

                $.cookie(COOKIE_NAME, '1', {
                    expires: 90,
                    path: '/'
                });
                self.hide();
            });

            $(document).scroll(function() {
                if ($.cookie(COOKIE_NAME)) {
                    return;
                }

                if (self.options.needToShow()) {
                    self.show();
                } else {
                    self.hide();
                }
            });
        }
    });
})(jQuery);

(function($) {
    var GifPlayer = function(options) {
        this.options = $.extend({
            container: null
        }, options);

        this.container = this.options.container;
    };

    Lixil.mixin(GifPlayer.prototype, {
        init: function() {
            if (!this.container.length) {
                return;
            }

            var gifImages = this.container.find('.js-gif-play');

            if (!gifImages.length) {
                return;
            }

            var playingAnimations = [];

            gifImages.on('click', function(e) {
                e.preventDefault();

                var link = $(this);
                var img = link.find('img.js-view').first();
                if (img.length) {
                    if (img.data('play') == '0') {
                        e.stopPropagation();

                        var gifUrl = img.data('src');
                        var offset = img.offset();

                        img.attr('src', gifUrl);
                        img.data('play', '1');

                        link.find('.js-play-button').hide();

                        playingAnimations.push({
                            id: img.attr('id'),
                            top: offset.top,
                            bottom: offset.top + img.height()
                        });
                    }
                }
            });

            $(document).scroll(function() {
                if (!playingAnimations.length) {
                    return;
                }

                var position = $(document).scrollTop();
                var displayBottom = position + $(window).height();
                $.each(playingAnimations, function(index, element) {
                    if (position > element.bottom || displayBottom < element.top) {
                        var img = $('#' + element.id);
                        var link = img.closest('.js-gif-play');
                        var previewUrl = img.data('preview');

                        img.attr('src', previewUrl);
                        img.data('play', '0');

                        link.find('.js-play-button').show();

                        var countAnimations = playingAnimations.length;
                        for (var i = 0; i < countAnimations; i++) {
                            if (playingAnimations[i].id == img.attr('id')) {
                                playingAnimations.splice(i, 1);
                                break;
                            }
                        }
                    }
                });
            });
        }
    });

    Lixil.export('AdMeCommon.Article.GifPlayer', GifPlayer);
})(jQuery);

(function($) {
    AdMeCommon.Article.Loader.Standard = function(options) {
        this.options = options;
        this.options = $.extend({
            container: null,
            url: '',
            sortType: 'straight'
        }, this.options);
        this.container = this.options.container;
        this.data = null;
    };

    Lixil.mixin(AdMeCommon.Article.Loader.Standard.prototype, {
        load: function(callback) {
            if (this.data !== null && callback) {
                callback(this.data);
                return;
            }

            this.requestData(callback);
        },
        requestData: function(callback) {
            var self = this;
            $.ajax({
                url: self.options.url,
                type: 'GET',
                dataType: 'json',
                success: function(data) {
                    self.data = data;
                    self.filter();
                    self.sort();

                    if (callback) {
                        callback(self.data);
                    }
                }
            });
        },
        filter: function() {
            var self = this;
            $('.js-article-list-item').add('.js-article-content').each(function() {
                var id = $(this).data('id');
                if (id) {
                    var found = -1;
                    for (var i = 0; i < self.data.length; i++) {
                        if (id == self.data[i].id) {
                            found = i;
                            break;
                        }
                    }
                    if (found >= 0) {
                        self.data.splice(found, 1);
                    }
                }
            });
        },
        sort: function() {
            if (this.options.sortType == 'random') {
                var allVisitedIds = AdMeCommon.Article.Visited.getAll();
                var visited = [];
                var notVisited = [];
                for (var i = 0; i < this.data.length; i++) {
                    if ($.inArray(i, allVisitedIds)) {
                        visited.push(this.data[i]);
                    } else {
                        notVisited.push(this.data[i]);
                    }
                }
                visited = visited.sort(function() {
                    return 0.5 - Math.random();
                });
                notVisited = notVisited.sort(function() {
                    return 0.5 - Math.random();
                });
                this.data = [].concat(notVisited, visited);
            }
        },
        shift: function() {
            return this.data.shift();
        }
    });
})(jQuery);

