(function($) {
    var YOUTUBE_BLOCK_ID_PREFIX = 'js-youtube-';
    var YOUTUBE_WATCHED_TIME_CHECK_INTERVAL = 2;

    var players = [];

    var lastTime = null;
    var lastEvent = null;
    var totalWatched = 0;
    var currentVideo = null;
    var intervalId = null;

    AdMeCommon.Article.YoutubePlayer = function(options) {
        this.options = $.extend({
            container: null
        }, options);

        this.container = this.options.container;
    };

    Lixil.mixin(AdMeCommon.Article.YoutubePlayer.prototype, {
        init: function() {
            if (!this.container.length) {
                return;
            }

            $.getScript('//www.youtube.com/iframe_api');

            var self = this;

            window.onYouTubeIframeAPIReady = function() {
                self.container.each(function(i) {
                    $(this).attr('id', YOUTUBE_BLOCK_ID_PREFIX + i);

                    var urlAttrs = $(this).data('url-attrs');

                    var data = {
                        videoId: $(this).data('video-id'),
                        playerVars: urlAttrs,
                        events: {
                            onStateChange: self.onPlayerStateChange
                        }
                    };

                    if ($(this).attr('width')) {
                        data['width'] = $(this).attr('width');
                    }
                    if ($(this).attr('height')) {
                        data['height'] = $(this).attr('height');
                    }

                    var player = new YT.Player($(this).attr('id'), data);
                    players.push(player);
                });
            };
        },
        videoPlayingHandler: function(player) {
            var currentTime = player.getCurrentTime();

            if (lastTime !== null && currentTime > lastTime) {
                var diff = currentTime - lastTime;
                if (diff > YOUTUBE_WATCHED_TIME_CHECK_INTERVAL * 2) {
                    diff = YOUTUBE_WATCHED_TIME_CHECK_INTERVAL;
                }
                totalWatched += diff;
            }

            lastTime = currentTime;
        },
        startWatching: function (player) {
            if (intervalId === null) {
                this.videoPlayingHandler(player);

                var self = this;

                intervalId = setInterval(function() {
                    self.videoPlayingHandler(player);
                }, YOUTUBE_WATCHED_TIME_CHECK_INTERVAL * 1000);
            }
        },
        onPlayerStateChange: function (event) {
            switch (event.data) {
                case YT.PlayerState.ENDED:
                    //  
                    if ($('#js-youtube-social-buttons').length) {
                        $('#js-youtube-social-buttons').insertBefore(event.target.getIframe());
                        $('#js-youtube-social-buttons').show();
                    }

                    this.stopWatching(event.target);

                    break;
                case YT.PlayerState.PLAYING:
                    //  
                    this.startWatching(event.target);

                    currentVideo = event.target.getVideoUrl();

                    break;
                case YT.PlayerState.PAUSED:
                    //      
                    this.stopWatching(event.target);

                    break;
                case YT.PlayerState.BUFFERING:
                    //  (,     )
                    this.stopWatching(event.target);

                    break;
                case YT.PlayerState.CUED:
                    //   ,  
                    break;
            }

            lastEvent = event.data;
        },
        stopWatching: function (player) {
            var self = this;

            if (intervalId !== null) {
                clearInterval(intervalId);
                intervalId = null;

                self.videoPlayingHandler(player);
            }
            lastTime = null;
        }

    });
})(jQuery);
(function($) {
    var mobile = $('body.mobile').length ? true : false;

    AdMeCommon.Article.Slider = function(options) {
        this.options = $.extend({
            container: null
        }, options);

        this.container = this.options.container;
    };

    Lixil.mixin(AdMeCommon.Article.Slider.prototype, {
        init: function() {
            if (!this.container.length) {
                return;
            }

            this.bodyWidth = this.container.width();

            var self = this;
            var beforeAfterSlider = this.container.find('.js-before-after-slider');

            if (!beforeAfterSlider) {
                return;
            }

            beforeAfterSlider.on('mousemove', function(e) {
                e.preventDefault();
                self.moveHandler.call(this, e);
            });

            var lastTouchX = null;

            beforeAfterSlider.on('touchstart', function(e) {
                var touch = e.originalEvent.touches[0] || e.originalEvent.changedTouches[0];

                lastTouchX = touch.pageX;
            });

            beforeAfterSlider.on('touchend', function(e) {
                lastTouchX = null;
            });

            beforeAfterSlider.on('touchmove', function(e) {
                var touch = e.originalEvent.touches[0] || e.originalEvent.changedTouches[0];

                var deltaX = touch.pageX - parseInt(lastTouchX, 10);

                if (deltaX) {
                    self.moveHandler.call(this, touch);
                }
            });

            this.beforeAfterInit();

            if (mobile) {
                $(window).on('resize', function(e) {
                    self.bodyWidth = self.container.width();
                    self.beforeAfterInit();
                });
            }

            this.container.find('.js-wow-image > img').each(function(idx, img) {
                img = $(img);
                if (userAuthorized) {
                    img.attr('src', img.data('url'));
                } else {
                    img.parents('a').addClass('js-auth');
                }
            });
        },
        beforeAfterInit: function() {
            var self = this;

            this.container.find('.js-before-after-slider').each(function() {
                var img = $(this).find('img');
                var imgWidth = mobile ? self.bodyWidth + 'px' : img.attr('width') + 'px';
                var imgHeight = self.calcHeight(img.attr('width'), img.attr('height')) + 'px';
                $(this).css('width', imgWidth);
                $(this).css('height', imgHeight);
                img.attr('style', 'width: ' + imgWidth + '!important');

                $(this).find('.before').css('width', '50%');

                $(this).find('.hint').remove();
                // $(this).append('<div class="hint"> SLIDE </div>');
                $(this).find('.hint').css('top', Math.round(parseInt(imgHeight) / 2 - 20) + 'px').css('opacity', 0.9);
            });
        },
        calcHeight: function(width, height) {
            if (mobile) {
                var aspect = width / height;
                return Math.round(this.bodyWidth / aspect);
            }
            return height;
        },
        moveHandler: function(e) {
            var offset = $(this).offset();
            var iTopWidth = (e.pageX - offset.left);

            // set width of bottomimage div
            $(this).find('.before').width(iTopWidth);
            $(this).find('.hint').remove();
        }
    });
})(jQuery);
