(function($) {
    $(function() {
        AdMeCommon.Article.fadeOutVisitedArticles();

        $('.js-article-content').each(function(i, item) {
            var $item = $(item);
            AdMeCommon.Article.Visited.set($item.data('id'));
        });

        function insertAdvertToReccomendations(data) {
            // add advert #24931
            if ($('.js-recomend-native-ads-container li').length) {
                var advertBlock = $('.js-recomend-native-ads-container').find('li:first');
                var index = 3 + Math.floor(Math.random() * 3);
                $('.js-article-more-list li.js-article-list-item:eq(' + index + ')').replaceWith(advertBlock);
            }
        }

        //   
        $('.js-article-more-list').each(function(i, _item) {
            var list = $(_item);
            var loading = $('.js-article-more-rotater');
            var link = $('.js-article-more-link');
            var archiveLink = $('.js-article-more-archive-link');

            var loader;
            var loaderOptions = {
                container: list,
                sortType: list.data('sort-type')
            };

            if (list.data('sort-type') == 'random' && list.data('recommendations-enabled') == '1') {
                loader = new AdMeCommon.Article.Loader.Surfingbird(loaderOptions);
            } else {
                loaderOptions['url'] = list.data('url');
                loader = new AdMeCommon.Article.Loader.Standard(loaderOptions);
            }

            var filler = new AdMeCommon.Article.Filler({
                container: list,
                loader: loader
            });

            //     
            if (list.data('prefill')) {
                filler.prefill(insertAdvertToReccomendations);
            }

            //   
            if (list.data('autofill')) {
                filler.autofill();
                $('#js-aside').bind('height-change', function(event, newHeight) {
                    filler.autofill();
                });
            }

            //  "  ..."
            link.on('click', function(event) {
                link.hide();
                loading.show();
                filler.more(function() {
                    loading.hide();
                    var pageCount = parseInt(link.data('page-count')) || 1;
                    var page = parseInt(link.data('page')) || 1;
                    if (page < pageCount) {
                        link.data('page', page + 1).show();
                    } else if (archiveLink) {
                        archiveLink.show();
                    }
                });

                event.preventDefault();
                event.stopPropagation();
            });

            //        
            var mobileNextBigThing = $('.js-adme-mobile-next-big-thing');
            if (mobileNextBigThing.length) {
                function loadMore() {
                    loading.show();
                    filler.more(function() {
                        loading.hide();
                    });
                    setTimeout(function() {
                        $(window).bind('scroll', bindScroll);
                    }, 1000);
                }

                function bindScroll() {
                    if ($(window).scrollTop() + $(window).height() > $(document).height() - 60) {
                        $(window).unbind('scroll');
                        loadMore();
                    }
                }

                $(window).scroll(bindScroll);
            }
        });
    });
})(jQuery);


