(function($) {
    $(function() {
        var container = $('.js-article-content');

        if (!container.length) {
            return;
        }

        var initGifPlayer = function() {

            var gifImages = $(container).find('.js-gif-play');
            if (!gifImages.length) {
                return;
            }

            var playingAnimations = [];

            gifImages.on('click', function(e) {
                e.preventDefault();

                var link = $(this);
                var img = link.find('img.js-view').first();
                if (img.length) {
                    if (img.data('play') == '0') {
                        e.stopPropagation();

                        var gifUrl = img.data('src');
                        var offset = img.offset();

                        img.attr('src', gifUrl);
                        img.data('play', '1');

                        link.find('.js-play-button').hide();

                        playingAnimations.push({
                            id: img.attr('id'),
                            top: offset.top,
                            bottom: offset.top + img.height()
                        });
                    }
                }
            });

            $(document).scroll(function() {
                if (!playingAnimations.length) {
                    return;
                }

                var position = $(document).scrollTop();
                var displayBottom = position + $(window).height();
                $.each(playingAnimations, function(index, element) {
                    if (position > element.bottom || displayBottom < element.top) {
                        var img = $('#' + element.id);
                        var link = img.closest('.js-gif-play');
                        var previewUrl = img.data('preview');

                        img.attr('src', previewUrl);
                        img.data('play', '0');

                        link.find('.js-play-button').show();

                        var countAnimations = playingAnimations.length;
                        for (var i = 0; i < countAnimations; i++) {
                            if (playingAnimations[i].id == img.attr('id')) {
                                playingAnimations.splice(i, 1);
                                break;
                            }
                        }
                    }
                });

            });

        };

        initGifPlayer();
    });
})(jQuery);

